contracts/CarmelRegistry.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

import "./CarmelUtils.sol";

/// @custom:oz-upgrades-unsafe-allow external-library-linking
contract CarmelRegistry is Initializable {

    using CarmelUtils for *;

    struct Account {
        uint256 id;
        bytes32 username;
        bytes32 sysmeta0;
        bytes32 sysmeta1;
        bytes32 umeta0;
        bytes32 umeta1;
        bytes32 group;
        uint32 total_keys;
        uint32 total_addresses;
    }

    uint8 constant private ADMIN_PERM = 250;
    uint8 constant private START_PERM = 1;

    uint256 public total_accounts;

    mapping(address => uint8) public perms;
    mapping(bytes32 => Account) public accounts;
    mapping(bytes32 => bytes32[]) public usernames;
    mapping(bytes32 => uint256[]) public keys_x;
    mapping(bytes32 => uint256[]) public keys_y;
    mapping(bytes32 => address[]) public addresses;

    modifier requireAdmin() {
      require(perms[msg.sender] >= ADMIN_PERM, "Admin level required");
      _;
    }

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(
    ) initializer public {
        perms[msg.sender] = ADMIN_PERM;
    }

    function registerRaw (address addr, bytes32 grp, bytes32 username, bytes32[2] memory sh, bytes32[2] memory uh) public requireAdmin {
        Account memory account = accounts[username];
        require(account.username == bytes32(0), "The username already exists");

        Account memory acct = Account({ id: total_accounts, username: username, sysmeta0: sh[0], sysmeta1: sh[1], umeta0: uh[0], umeta1: uh[1], group: grp, total_keys: 0, total_addresses:1 });
        accounts[username] = acct;
        addresses[username].push(addr);
        usernames[grp].push(username);

        perms[addr] = START_PERM;
        total_accounts = total_accounts + 1;
    }

    function getGroup(bytes32 grp) public view returns (Account[] memory) {
        bytes32[] memory all = usernames[grp];
        uint total = all.length;
        Account[] memory accts = new Account[](total);

        for(uint i = 0; i < total; i++) {
            accts[i] = accounts[all[i]];
        }

        return accts;
    }

    function update (bytes32 username,  bytes32[2] memory sh, bytes32[2] memory uh) public requireAdmin {
        Account memory account = accounts[username];
        require(account.username != bytes32(0), "The account does not exist");

        accounts[username].sysmeta0 = sh[0];
        accounts[username].sysmeta1 = sh[1];
        accounts[username].umeta0 = uh[0];
        accounts[username].umeta1 = uh[1];
    }

    function updatePerms (address addr, uint8 level) public requireAdmin {
        perms[addr] = level;
    }

    function register (address addr, bytes32 grp, bytes32 username, uint256[2] memory k, bytes32[2] memory sh, bytes32[2] memory uh) public requireAdmin {
        Account memory account = accounts[username];
        require(account.username == bytes32(0), "The username already exists");

        Account memory acct = Account({ id: total_accounts, group: grp, username: username, sysmeta0: sh[0], sysmeta1: sh[1], umeta0: uh[0], umeta1: uh[1], total_keys: 1, total_addresses:1 });
        accounts[username] = acct;

        keys_x[username].push(k[0]);
        keys_y[username].push(k[1]);
        addresses[username].push(addr);
        usernames[grp].push(username);

        perms[addr] = START_PERM;
        total_accounts = total_accounts + 1;
    }

    function addKey (bytes32 username, uint256[2] memory k) public requireAdmin {
        Account memory account = accounts[username];
        require(account.username != bytes32(0), "The account does not exist");

        keys_x[username].push(k[0]);
        keys_y[username].push(k[1]);
        accounts[username].total_keys = account.total_keys + 1;
    }

    function addAddress(address addr, bytes32 username) public requireAdmin {
        Account memory account = accounts[username];
        require(account.username != bytes32(0), "The account does not exist");

        addresses[username].push(addr);
        accounts[username].total_addresses = account.total_addresses + 1;
    }

    function authenticate (bytes32 username, uint256 keyId, string memory command, bytes memory authData, string memory source, uint[2] memory signature) public view returns(bool) {
        Account memory account = accounts[username];

        require(account.username != bytes32(0), "The account does not exist");
        require(keys_x[username].length > keyId && keys_y[username].length > keyId, "Invalid device");

        uint256 x = keys_x[username][keyId];
        uint256 y = keys_y[username][keyId];

        bytes32 cmdhash = sha256(abi.encodePacked(command));
        string memory challenge = CarmelUtils.bytes32ToBase64String(cmdhash);

        require(account.username != bytes32(0), "The username does not exist");
        uint digest = uint(sha256(abi.encodePacked(authData, sha256(abi.encodePacked("{\"type\":\"webauthn.get\",\"challenge\":\"", challenge, "\",\"origin\":\"", source, "\",\"crossOrigin\":false}")))));

        return CarmelUtils.validateSignature(digest, signature, [x, y]);
    }
}

